import React from 'react'
import TopNavBar from './TopNavBar'
import CountdownTimer from './CountdownTimer'
import { connect } from 'react-redux'
import { getCountdownTime } from '../actions/countdownTimerActions'

const deadlineDate = new Date('September 31, 2019 23:59:59').getTime()

const ComingSoon = props => {

  setInterval(() => {
    return props.getCDTime()
  }, 1000)

  return (
    <div className='coming-soon-page'>
      <TopNavBar {...props} buttonName={"Login"} navPath={"/login"} />
      <CountdownTimer deadlineDate={deadlineDate} {...props.time}/>
    </div>
  )
}

const mapStateToProps = state => ({
  time: state.countdownTime
})

const mapDispatchToProps = {
  getCDTime: getCountdownTime
}

export default connect(mapStateToProps, mapDispatchToProps)(ComingSoon)
